module SampleScenario.PicturesOfEnemies (picOfEnemies) where

import Control.CUI

picOfEnemies :: Int -> Craphic
picOfEnemies n = fromTextsA ' ' 'w' ts'
  where
    ts  = txtOf n
    ts' = (if length ts < 40 then replicate (40 - length ts) "" else []) ++ ts

